import React from "react";
import "../styles/Navbar.css";


function Navbar() {
  return (
    <div className="nav">
      <div className="logo">
        <img src="/openart-image_D4l7gu6n_1729523728362_raw.jpg" alt="" />{" "}
      </div>

      <div className="linkspage">
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/Box">Box</a>
          </li>
          <li>
            <a href="/About">About</a>
          </li>
        </ul>
      </div>

      <div className="search">
        <input type="text" placeholder="Search" />
      </div>
    </div>
  );
}

export default Navbar;
